import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const ManageVehicles = () => {
  const navigate = useNavigate();
  const [vehicles, setVehicles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);
  const [editingVehicle, setEditingVehicle] = useState(null);

  // Mock vehicles data with bikes and cars
  const mockVehicles = [
    {
      id: 1,
      name: 'Yamaha R15 V4',
      type: 'Bike',
      price: 299,
      image: 'https://images.unsplash.com/photo-1558618666-fcd25c85cd64?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 2,
      name: 'KTM Duke 390',
      type: 'Bike',
      price: 399,
      image: 'https://images.unsplash.com/photo-1568772585407-9361f9bf3a87?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 3,
      name: 'Royal Enfield Classic 350',
      type: 'Bike',
      price: 249,
      image: 'https://images.unsplash.com/photo-1558618047-3c8c76ca7d13?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2023,
      fuel: 'Petrol'
    },
    {
      id: 4,
      name: 'Honda CBR 650R',
      type: 'Bike',
      price: 599,
      image: 'https://images.unsplash.com/photo-1609630875171-b1321377ee65?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Rented',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 5,
      name: 'BMW M4 Coupe',
      type: 'Car',
      price: 899,
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 6,
      name: 'Mercedes-Benz S-Class',
      type: 'Car',
      price: 1299,
      image: 'https://images.unsplash.com/photo-1563720223185-11003d516935?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 7,
      name: 'Kawasaki Ninja ZX-10R',
      type: 'Bike',
      price: 799,
      image: 'https://images.unsplash.com/photo-1558618047-3c8c76ca7d13?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Petrol'
    },
    {
      id: 8,
      name: 'Harley Davidson Street 750',
      type: 'Bike',
      price: 699,
      image: 'https://images.unsplash.com/photo-1558618666-fcd25c85cd64?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2023,
      fuel: 'Petrol'
    },
    {
      id: 9,
      name: 'Tesla Model S',
      type: 'Car',
      price: 1599,
      image: 'https://images.unsplash.com/photo-1617788138017-80ad40651399?ixlib=rb-4.0.3&auto=format&fit=crop&w=800&q=80',
      status: 'Available',
      year: 2024,
      fuel: 'Electric'
    }
  ];

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      setVehicles(mockVehicles);
      setLoading(false);
    }, 500);
  }, []);

  const handleEdit = (vehicle) => {
    setEditingVehicle(vehicle);
    setShowModal(true);
  };

  const handleDelete = (vehicleId) => {
    if (window.confirm('Are you sure you want to delete this vehicle?')) {
      setVehicles(vehicles.filter(v => v.id !== vehicleId));
    }
  };

  const handleSave = (vehicleData) => {
    if (editingVehicle) {
      // Update existing vehicle
      setVehicles(vehicles.map(v =>
        v.id === editingVehicle.id ? { ...v, ...vehicleData } : v
      ));
    } else {
      // Add new vehicle
      const newVehicle = {
        id: Math.max(...vehicles.map(v => v.id)) + 1,
        ...vehicleData
      };
      setVehicles([...vehicles, newVehicle]);
    }
    setShowModal(false);
    setEditingVehicle(null);
  };

  if (loading) {
    return (
      <div className="d-flex" style={{ minHeight: '100vh' }}>
        {/* Sidebar */}
        <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
          <h4 className="text-white mb-4">Admin Panel</h4>
          <ul className="nav flex-column">
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
                <i className="fas fa-tachometer-alt me-2"></i> Dashboard
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/cars')}>
                <i className="fas fa-motorcycle me-2"></i> Vehicles
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/users')}>
                <i className="fas fa-users me-2"></i> Users
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/bookings')}>
                <i className="fas fa-calendar-alt me-2"></i> Bookings
              </button>
            </li>
          </ul>
        </aside>

        {/* Main Content */}
        <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
          <div className="text-center p-5">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
            <p className="mt-3">Loading vehicles...</p>
          </div>
        </main>
      </div>
    );
  }

  return (
    <div className="d-flex" style={{ minHeight: '100vh' }}>
      {/* Sidebar */}
      <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
        <h4 className="text-white mb-4">Admin Panel</h4>
        <ul className="nav flex-column">
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
              <i className="fas fa-tachometer-alt me-2"></i> Dashboard
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/cars')}>
              <i className="fas fa-motorcycle me-2"></i> Vehicles
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/users')}>
              <i className="fas fa-users me-2"></i> Users
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/bookings')}>
              <i className="fas fa-calendar-alt me-2"></i> Bookings
            </button>
          </li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
        <div className="d-flex justify-content-between align-items-center p-4 bg-white border-bottom">
          <h2 className="mb-0">Manage Vehicles</h2>
          <div>
            <button
              className="btn btn-success btn-sm me-2"
              onClick={() => {
                setEditingVehicle(null);
                setShowModal(true);
              }}
            >
              <i className="fas fa-plus me-1"></i> Add Vehicle
            </button>
            <button className="btn btn-outline-danger btn-sm" onClick={() => { localStorage.removeItem('token'); navigate('/admin/login'); }}>
              <i className="fas fa-sign-out-alt me-1"></i> Logout
            </button>
          </div>
        </div>

        <div className="p-4">
          <div className="bg-white rounded shadow-sm">
            <div className="table-responsive">
              <table className="table table-striped mb-0">
                <thead style={{ background: '#f8f9fa' }}>
                  <tr>
                    <th className="px-4 py-3">ID</th>
                    <th className="px-4 py-3">Image</th>
                    <th className="px-4 py-3">Name</th>
                    <th className="px-4 py-3">Type</th>
                    <th className="px-4 py-3">Price/Day</th>
                    <th className="px-4 py-3">Year</th>
                    <th className="px-4 py-3">Fuel</th>
                    <th className="px-4 py-3">Status</th>
                    <th className="px-4 py-3">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {vehicles.map((vehicle) => (
                    <tr key={vehicle.id}>
                      <td className="px-4 py-3">{vehicle.id}</td>
                      <td className="px-4 py-3">
                        <img
                          src={vehicle.image}
                          alt={vehicle.name}
                          style={{ width: '60px', height: '40px', objectFit: 'cover', borderRadius: '4px' }}
                        />
                      </td>
                      <td className="px-4 py-3">{vehicle.name}</td>
                      <td className="px-4 py-3">
                        <span className={`badge ${vehicle.type === 'Bike' ? 'bg-info' : 'bg-primary'}`}>
                          {vehicle.type}
                        </span>
                      </td>
                      <td className="px-4 py-3">₹{vehicle.price}</td>
                      <td className="px-4 py-3">{vehicle.year}</td>
                      <td className="px-4 py-3">{vehicle.fuel}</td>
                      <td className="px-4 py-3">
                        <span className={`badge ${vehicle.status === 'Available' ? 'bg-success' : 'bg-warning text-dark'}`}>
                          {vehicle.status}
                        </span>
                      </td>
                      <td className="px-4 py-3">
                        <button
                          className="btn btn-outline-primary btn-sm me-2"
                          onClick={() => handleEdit(vehicle)}
                        >
                          <i className="fas fa-edit me-1"></i> Edit
                        </button>
                        <button
                          className="btn btn-outline-danger btn-sm"
                          onClick={() => handleDelete(vehicle.id)}
                        >
                          <i className="fas fa-trash me-1"></i> Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>

      {/* Add/Edit Vehicle Modal */}
      {showModal && (
        <div className="modal fade show" style={{ display: 'block', backgroundColor: 'rgba(0,0,0,0.5)' }}>
          <div className="modal-dialog modal-lg">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">
                  {editingVehicle ? 'Edit Vehicle' : 'Add New Vehicle'}
                </h5>
                <button
                  type="button"
                  className="btn-close"
                  onClick={() => {
                    setShowModal(false);
                    setEditingVehicle(null);
                  }}
                ></button>
              </div>
              <div className="modal-body">
                <VehicleForm
                  vehicle={editingVehicle}
                  onSave={handleSave}
                  onCancel={() => {
                    setShowModal(false);
                    setEditingVehicle(null);
                  }}
                />
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

// Vehicle Form Component
const VehicleForm = ({ vehicle, onSave, onCancel }) => {
  const [formData, setFormData] = useState({
    name: vehicle?.name || '',
    type: vehicle?.type || 'Car',
    price: vehicle?.price || '',
    year: vehicle?.year || new Date().getFullYear(),
    fuel: vehicle?.fuel || 'Petrol',
    status: vehicle?.status || 'Available',
    image: vehicle?.image || ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(formData);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="row">
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Vehicle Name</label>
            <input
              type="text"
              className="form-control"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>
        </div>
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Type</label>
            <select
              className="form-select"
              name="type"
              value={formData.type}
              onChange={handleChange}
              required
            >
              <option value="Car">Car</option>
              <option value="Bike">Bike</option>
            </select>
          </div>
        </div>
      </div>

      <div className="row">
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Price per Day (₹)</label>
            <input
              type="number"
              className="form-control"
              name="price"
              value={formData.price}
              onChange={handleChange}
              required
            />
          </div>
        </div>
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Year</label>
            <input
              type="number"
              className="form-control"
              name="year"
              value={formData.year}
              onChange={handleChange}
              min="2000"
              max={new Date().getFullYear() + 1}
              required
            />
          </div>
        </div>
      </div>

      <div className="row">
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Fuel Type</label>
            <select
              className="form-select"
              name="fuel"
              value={formData.fuel}
              onChange={handleChange}
              required
            >
              <option value="Petrol">Petrol</option>
              <option value="Diesel">Diesel</option>
              <option value="Electric">Electric</option>
              <option value="Hybrid">Hybrid</option>
            </select>
          </div>
        </div>
        <div className="col-md-6">
          <div className="mb-3">
            <label className="form-label">Status</label>
            <select
              className="form-select"
              name="status"
              value={formData.status}
              onChange={handleChange}
              required
            >
              <option value="Available">Available</option>
              <option value="Rented">Rented</option>
              <option value="Maintenance">Maintenance</option>
            </select>
          </div>
        </div>
      </div>

      <div className="mb-3">
        <label className="form-label">Image URL</label>
        <input
          type="url"
          className="form-control"
          name="image"
          value={formData.image}
          onChange={handleChange}
          placeholder="https://example.com/image.jpg"
        />
      </div>

      <div className="d-flex justify-content-end gap-2">
        <button type="button" className="btn btn-secondary" onClick={onCancel}>
          Cancel
        </button>
        <button type="submit" className="btn btn-primary">
          {vehicle ? 'Update Vehicle' : 'Add Vehicle'}
        </button>
      </div>
    </form>
  );
};

export default ManageVehicles;
